import React, { Component } from 'react'
import {Link} from 'react-router-dom'

class Navbar extends Component {
  render() {
    return (
      <nav className="navbar">
        <Link to="/"><img src="fat_bird.svg"/></Link>
        <span><Link to="/quiz"  className={this.props.active == "quiz"? "active" : null}>Quiz</Link></span>
        <span><Link to="/results" className={this.props.active == "results"? "active" : null}>Results</Link></span>
        <span><Link to="/" className={this.props.active == "itinerary"? "active" : null}>Itinerary</Link></span>
        <span><Link to="/" className={this.props.active == "book"? "active" : null}>Book</Link></span>
        <img src="hamburger.svg"/>
      </nav>
    )
  }
}

export default Navbar;
